import React, { useState } from 'react';
import './App.css';

function App() {
  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const [formData, setFormData] = useState({
    writing_score: '',
    reading_score: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setLoading(true);
    
    // Simulate API call
    setTimeout(() => {
      const writing = parseFloat(formData.writing_score);
      const reading = parseFloat(formData.reading_score);
      const mockPrediction = Math.floor((writing + reading) / 2 * 0.9);
      setPrediction(mockPrediction);
      setLoading(false);
    }, 1000);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Student Performance Predictor</h1>
        <p>Predict math scores based on student characteristics</p>
      </header>
      
      <main className="App-main">
        <form onSubmit={handleSubmit} className="prediction-form">
          <h2>Test Prediction</h2>
          
          <div className="form-group">
            <label htmlFor="writing_score">Writing Score:</label>
            <input
              type="number"
              id="writing_score"
              name="writing_score"
              value={formData.writing_score}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="form-group">
            <label htmlFor="reading_score">Reading Score:</label>
            <input
              type="number"
              id="reading_score"
              name="reading_score"
              value={formData.reading_score}
              onChange={handleChange}
              required
            />
          </div>
          
          <button type="submit" className="predict-button">
            Predict Math Score
          </button>
        </form>
        
        {loading && <div className="loading">Processing your prediction...</div>}
        
        {prediction !== null && !loading && (
          <div className="result-display">
            <h2>Prediction Result</h2>
            <div className="prediction-value">
              Predicted Math Score: <span>{prediction}</span>
            </div>
          </div>
        )}
      </main>
    </div>
  );
}

export default App;
